∀ {E : Type u} [inst : NormedAddCommGroup E] [inst_1 : NormedSpace ℂ E] (f : ℂ → E) {γ : ℂ → ℂ}
  (hγ : Continuous γ) (hγ_closed : γ 0 = γ 1) (hf : ∀ z, DifferentiableAt ℂ f z),
  ∮ z in γ, f z = 0

∀ {E : Type u_1} [inst : NormedAddCommGroup E] [inst_1 : NormedSpace ℂ E] (f : ℂ → E) {γ : ℂ → ℂ} {C : Set ℂ}
  (hγ : ContinuousOn γ C) (hC : IsClosed C) (hf : ∀ z ∈ C, DifferentiableAt ℂ f z),
  (∮ z in C, f z) = 0
